import React, { useState } from "react";
import { HashLink as Link } from "react-router-hash-link";

const navLinks = [
  { to: "#", text: "Home" },
  { to: "#access", text: "About Us" },
  { to: "#solutions", text: "Solutions" },
  { to: "#blogs", text: "Blogs" },
  { to: "#trails", text: "Trails" },
  { to: "#contact", text: "Contact Us" },
];

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <div>
      <div className="flex gap-2 text-white justify-between items-center p-6 fixed bg-[#392B85] w-full z-20 cursor-pointer">
        <div className="flex items-center">
          <img src="images/logo 1.png" alt="logo" className="h-8 w-auto" />
          <button
            className="lg:hidden ml-2 text-white"
            onClick={() => setIsMenuOpen(!isMenuOpen)}
          >
            â˜°
          </button>
        </div>
        <div className={`lg:flex space-x-2 ${isMenuOpen ? "block" : "hidden"}`}>
          {navLinks.map((link, index) => (
            <Link key={index} to={link.to} smooth>
              <span>{link.text}</span>
            </Link>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Header;
